let likeBtns = document.querySelectorAll('.like-btn');

if ( likeBtns.length ){
    likeBtns.forEach( btn => {
        btn.addEventListener('click', function(){
            if ( btn.classList.contains('active') ){
                btn.classList.remove('active')
            } else{
                btn.classList.add('active')
            }
        })
    } )
}